import { useState } from "react";

/** components */
import { Button } from "@button";

/** styles */
import layout from "@styles/layout.module.scss";
import space from "@styles/space.module.scss";
import shape from "@styles/shape.module.scss";
import color from "@styles/color.module.scss";

/** Prototypes */
import { Prototype as GlobePrototype } from "@prototype/globe";

/** contexts */
import { useToggleDispatch } from "@context/toggle";

export const GlobeModal: React.FC<{}> = () => {
  const toggleDispatch = useToggleDispatch();
  const [Prototype, setPrototype] = useState("language");
  return (
    <div
      className={[
        shape["h--full"],
        shape["shadow--lg"],
        shape["br--16"],
        color["bg--white"],
      ].join(" ")}
    >
      <div className={[space["p--12"]].join(" ")}>
        <div>
          <Button
            variant="modal"
            modal="close"
            onClick={() => toggleDispatch({ type: "toggle_globe" })}
          />
        </div>
      </div>

      <div className={[space["p-h--20"], space["p-v--8"]].join(" ")}>
        <div
          className={[
            layout["flex"],
            layout["items-center"],
            space["m-b--50"],
          ].join(" ")}
        >
          <div className={[space["m-r--32"]].join(" ")}>
            <Button
              variant="underline"
              title="Language and region"
              font={16}
              bold
              unselected={Prototype !== "language"}
              onClick={() => setPrototype("language")}
            />
          </div>
          <div>
            <Button
              variant="underline"
              title="Currency"
              font={16}
              bold
              unselected={Prototype !== "currency"}
              onClick={() => setPrototype("currency")}
            />
          </div>
        </div>
        <GlobePrototype variant={Prototype} />
      </div>
    </div>
  );
};
